import { GET_STOCK_INFO} from '../actions/types';
import _ from 'lodash';


export default (state = {}, action) => {
  switch (action.type) {
    case GET_STOCK_INFO:
        return {...state,[action.payload]:action.payload };
    default:
      return state;
  }
};
